                        <th>19:00</th>
                        <th>20:00</th>
                    </tr>
                </thead>
                <tbody>
                    {userData.map((user) => (
                        <tr key={user.id}>
                            <td>{user.day}</td>
                            {Object.keys(user.plan).map((time) => (
                                <td key={time}>{user.plan[time]}</td>
                            ))}
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}
